#
# Structure for table "vote_task"
#

DROP TABLE IF EXISTS `vote_task`;
CREATE TABLE `vote_task` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `url` varchar(255) DEFAULT NULL COMMENT '投票链接',
  `total_quantity` int(11) DEFAULT NULL COMMENT '总数量',
  `option` varchar(255) DEFAULT NULL COMMENT '选项',
  `unit_price` decimal(10,2) DEFAULT NULL COMMENT '单价',
  `price` decimal(10,2) DEFAULT NULL COMMENT '总价',
  `status` int(11) DEFAULT NULL COMMENT '状态',
  `finish_quantity` int(11) DEFAULT NULL COMMENT '完成数量',
  `order_time` datetime DEFAULT NULL COMMENT '下单时间',
  `finish_time` datetime DEFAULT NULL COMMENT '完成时间',
  `note` varchar(255) DEFAULT NULL COMMENT '备注',
  `user_id` int(11) DEFAULT NULL COMMENT '下单用户',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

